import { React } from 'react';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

import globalStyle from './src/styles/style';
import Main from './src/components/Main';
import Login from './src/components/Login';
import Excercises from './src/components/Excercises';
import ExcerciseType from './src/components/ExcerciseType';
import Survey from './src/components/Survey';

const Stack = createStackNavigator();

export default function Navigate() {

    return <NavigationContainer>
        <Stack.Navigator>
            <Stack.Group>
                <Stack.Screen
                    name="MainScreen"
                    component={Main}
                    options={{title: 'Главная'}}
                    />
                <Stack.Screen
                    name="ExcercisesScreen"
                    component={Excercises}
                    options={{title: 'Виды упражнений'}}
                    />
                <Stack.Screen
                    name="ExcerciseTypeScreen"
                    component={ExcerciseType}
                    options={{title: 'Упражнение'}}
                    />
                <Stack.Screen
                    name="LoginScreen"
                    component={Login}
                    options={{title: 'Авторизация'}}
                    />
                <Stack.Screen
                    name="SurveyScreen"
                    component={Survey}
                    options={{title: 'Опрос'}}
                    />
            </Stack.Group>
        </Stack.Navigator>
    </NavigationContainer>
}
